import React , {useState , useEffect} from 'react';
import { useParams } from 'react-router';

const Scandata=props=>{

    const params=useParams()
    const [macros, setmacros] = useState(params.productbarcode);

    useEffect(() => {
        fetch(
            'https://world.openfoodfacts.org/api/v0/product/3017620422003.json'
        )
          .then((response) => response.json())
          .then((data) => {
            setmacros(data.product.nutriments)
          
          })
          .catch(() => {
            console.log("error");
          })},[])
   
   
  
    return (
        <>
        <h1>Carbs {macros.carbohydrates_value}</h1>
        <h1>Proteins {macros.proteins}</h1>
        <h1>Fats {macros.fat}</h1>
     
        </>

    )

}
export default Scandata;
